import React, { useState } from 'react';
import { Button, Navbar, Nav, Offcanvas, Form, FormControl } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import { FaBars } from 'react-icons/fa';  // Importing FontAwesome Hamburger Icon
import Login from './Login';
import Signup from './Signup';
import AdminLogin from './AdminLogin'; // Import AdminLogin component

const CustomNavbar = () => {
    const [showOffcanvas, setShowOffcanvas] = useState(false);  // State for offcanvas (hamburger) menu
    const [showLogin, setShowLogin] = useState(false);
    const [showSignup, setShowSignup] = useState(false);
    const [showAdminLogin, setShowAdminLogin] = useState(false); // State for AdminLogin modal

    const handleLoginClose = () => setShowLogin(false);
    const handleSignupClose = () => setShowSignup(false);
    const handleAdminLoginClose = () => setShowAdminLogin(false); // Close admin modal

    const handleOffcanvasClose = () => setShowOffcanvas(false);
    const handleOffcanvasShow = () => setShowOffcanvas(true);  // Function to show the offcanvas menu

    const handleContactClick = () => {
        const element = document.getElementById('contact-details');
        if (element) {
            element.scrollIntoView({ behavior: 'smooth' });
        }
    };

    return (
        <>
            <Navbar className="navbar" expand="lg" style={{ backgroundColor: '#007bff' }}>
                {/* Hamburger Icon on the Left */}
                <Navbar.Brand className="d-flex align-items-center">
                    <FaBars onClick={handleOffcanvasShow} style={{ cursor: 'pointer', color: '#fff' }} /> {/* Clickable Hamburger Icon */}
                </Navbar.Brand>

                {/* Centered Website Name */}
                <Navbar.Text className="mx-auto" style={{ color: '#fff', fontWeight: 'bold' }}>
                    <Link to="/" className="navbar-brand" style={{ color: '#fff' }}>The Event Solution</Link>
                </Navbar.Text>

                {/* Search Bar on the Right */}
                <Form className="ml-auto d-flex" style={{ marginLeft: 'auto' }}>
                    <FormControl
                        type="search"
                        placeholder="Search Events"
                        className="mr-2"
                        aria-label="Search"
                    />
                    <Button variant="outline-light">Search</Button>
                </Form>

                {/* Login and Signup buttons */}
                <Nav className="ml-auto">
                    <Button className="btn btn-primary mr-2" onClick={() => setShowLogin(true)}>Login</Button>
                    <Button className="btn btn-success mr-2" onClick={() => setShowSignup(true)}>Sign Up</Button>
                </Nav>
            </Navbar>

            {/* Offcanvas (Hamburger) Menu */}
            <Offcanvas show={showOffcanvas} onHide={handleOffcanvasClose} placement="start">
                <Offcanvas.Header closeButton>
                    <Offcanvas.Title>Menu</Offcanvas.Title>
                </Offcanvas.Header>
                <Offcanvas.Body>
                    <Nav className="flex-column">
                        <Nav.Link as={Link} to="/">Home</Nav.Link>
                        <Nav.Link as={Link} to="/MyEvents">My Events</Nav.Link>
                        <Nav.Link as={Link} to="/PastEvents">Past Events</Nav.Link>
                        <Nav.Link onClick={handleContactClick}>Contact Us</Nav.Link>
                        <Nav.Link onClick={() => setShowAdminLogin(true)}>Admin Login</Nav.Link>
                    </Nav>
                </Offcanvas.Body>
            </Offcanvas>

            {/* Modals for Login, Signup, and AdminLogin */}
            <Login show={showLogin} handleClose={handleLoginClose} onLoginSuccess={() => alert('Logged in successfully')} />
            <Signup show={showSignup} handleClose={handleSignupClose} />
            <AdminLogin show={showAdminLogin} handleClose={handleAdminLoginClose} onLoginSuccess={() => alert('Admin logged in successfully')} />
        </>
    );
};

export default CustomNavbar;
